INSERT INTO `project` VALUES (2,'특화','2022-05-18 14:11:02.362487','','https://github.com/eunseo130/Retter',15,'TTS를 이용한 음성카드 만들기 서비스입니다','# Re:tter\n> ? 소중한 사람들에게 마음을 전해요.\nTTS 모델을 활용한 음성카드 만들기 서비스\n\n1. 일정 : 2021.02.12 - 2021.04.08 (총 7주)\n\n2. 인원 (총 6인)\n\n   - 김은서 : 팀장, Backend, AI, Infra\n   - 김혜인 : Frontend\n   - 노건우 : Backend, AI\n   - 서예진 : Backend, AI\n   - 성당현 : Frontend\n   - 윤지영 : Backend, AI, Infra\n\n3. 기술 스택\n\n   - Frontend : React\n   - Backend : django, Python\n   - AI : Pytorch\n   - Infra : Docker\n   - DB : MySQL\n\n4. 아키텍처\n\n​	![architecture](https://github.com//eunseo130/Retter/raw/master/README.assets/architecture.PNG)\n\n\n5. 주요 기능\n\n![009](https://github.com//eunseo130/Retter/raw/master/README.assets/009.png)\n\n![010](https://github.com//eunseo130/Retter/raw/master/README.assets/010.png)	\n\n![011](https://github.com//eunseo130/Retter/raw/master/README.assets/011.png)\n\n![012](https://github.com//eunseo130/Retter/raw/master/README.assets/012.png)\n\n','Re:tter','http://k6c104.p.ssafy.io/images/projectImg/fa3a24f8-53ed-46c1-b13d-b061e4dfe9f5_011.png','Re:tter','2022-05-19 11:23:38.696080','qrdb2PBV/AcIthoFenbgKyoflBSvCPAwb+1JOLyb28k='),(3,'특화','2022-05-18 14:11:55.668562','','https://github.com/hyunse0/docong',27,'원격 일잘러들을 위한 집중 서비스입니다.','\n\n# 두콩(DOCONG)\n\n<img width=\"1459\" alt=\"image\" src=\"https://user-images.githubusercontent.com/44612896/161991250-2d06877d-f4d6-4911-9c94-7ea4c364bc72.png\">\n\n<br/>\n\n**웹 기반 Pomodoro Timer 및 집중 시간 분석 서비스**\n\n> 여러분은 집중을 잘하고 계신가요?<br/>\n> 얼마나 프로젝트에 집중했는지? 어떤 분야에 내가 시간을 투자했는지? 궁금한 적이 있지 않으신가요?\n>\n> <br/>\n>\n> <br/>\n>\n> 할 일을 생성하고 타이머 사용해 최대한 집중력을 발휘해 보세요! <br/>\n> 콩을 분석해서 여러분의 시간을 분석해보세요!\n>\n> <br/>\n\n<br><br>\n\n## 프로젝트 목차\n- [두콩(DOCONG)](#두콩DOCONG)\n  - [프로젝트 목차](#프로젝트-목차)\n  - [1️⃣ 프로젝트 소개](#1️⃣-프로젝트-소개)\n    - [? 기술 스택](#-기술-스택)\n    - [? 애플리케이션 아키텍처](#-애플리케이션-아키텍처)\n    - [? 디자인](#-디자인)\n  - [2️⃣ 프로젝트 파일 구조](#2️⃣-프로젝트-파일-구조)\n    - [Backend](#backend)\n    - [Frontend](#frontend)\n  - [4️⃣ 프로젝트 산출물](#4️⃣-프로젝트-산출물)\n  - [5️⃣ 프로젝트 결과](#5️⃣-프로젝트-결과)\n  <br><br>\n\n## 1️⃣ 프로젝트 소개\n1. 일정 : 2021-02-12 ~ 2021-04-07 (총 7주)\n2. 인원 (총 5인)\n    - [이정음](https://github.com/jeongum) : 팀장, Backend,  Machine Learning\n    - [김영훈](https://github.com/HoonyCode) : Backend, Infra\n    - [유혜승](https://github.com/hazel-u) : Backend, Frontend\n    - [이재희](https://github.com/Hui-Story) : Frontend\n    - [이남수]() : Backend, Infra\n    - [하현서](https://github.com/hyunse0) : Backend, Machine Learning\n\n<br><br>\n\n### ? 기술 스택\n\n1. 이슈관리 : Jira\n2. 형상관리 : Gitlab\n3. 커뮤니케이션 : Mattermost, Notion, slack\n4. 디자인 : Figma\n5. 개발 환경\n   - OS : Windwos 10\n   - DB : MariaDB 10.7.3\n   - Server : AWS EC2, Ubuntu 20.04, Jenkins 2.303.2, nginx 1.18.0\n6. Frontend\n   - HTML5, node-sass 7.0.1, TypeScript 4.6.2\n   - React 17.0.2, react-redux 7.2.6, Node.js 16.14.0, Yarn 1.22.17\n   - redux-saga 1.1.3, react-router-dom 6.2.2, styled-components 5.3.3, material-ui 5.5.0, react-apexcharts 1.4.0\n7. Backend\n   - Java JDK 11\n   - SpringBoot 2.6.4, Spring JPA, Spring Security\n   - Lombok 1.18.20, Swagger 2.9.2, jwt 3.18.2\n8. Machine Learning\n   -  pandas \n   - scikit-learn \n10. IDE&Tool\n    - intelliJ 21.3.2\n    - HeidiSQL\n    - Visual Studio Code 1.65.2\n\n<br><br>\n\n### ? 애플리케이션 아키텍처\n\n<img width=\"1000\" alt=\"image\" src=\"https://user-images.githubusercontent.com/44612896/162042288-b1597f5b-c9f1-465c-8d26-1f9f4dc8263e.png\">\n\n<br><br>\n\n### ? 디자인\n\n<img width=\"1000\" alt=\"image\" src=\"https://user-images.githubusercontent.com/44612896/162036475-7e91caab-928e-4ff4-9130-7635045c7fc3.png\">\n\n<br><br>\n\n## 2️⃣ 프로젝트 파일 구조\n\n### Backend\n\n```\nbackend/docong/src\n├── main\n│   ├── java\n│   │   └── com\n│   │       └── b5f1\n│   │           └── docong\n│   │               ├── DocongApplication.java\n│   │               ├── aop\n│   │               ├── api\n│   │               │   ├── controller\n│   │               │   │   └── ...\n│   │               │   ├── dto\n│   │  