on.site/616eabbded3d4e1a93503a98135811fd) |\n| **Wireframe**                  | [바로가기](https://www.figma.com/file/9Zam5pM8ZUlpRlAYgzl2I5?embed_host=notion&kind=&node-id=207%3A275&viewer=1) |\n| **Mockup & Prototype**         | [바로가기](https://www.figma.com/file/VoUaXkmQT3bf7t7E5Lw3YX?embed_host=notion&kind=&node-id=0%3A1&viewer=1) |\n| **유저가이드**                 | [바로가기](https://mangrove-purchase-535.notion.site/Docong-User-Guide-5591e2fb4f87445e82e55bd34e5b6bbe) |\n| **ERD**                        | [바로가기](https://hoonycode.notion.site/9aeabbaf31f94b39ba48f7584ed7d118) |\n| **BackEnd - API Docs**         | [바로가기](https://hoonycode.notion.site/d72a1a3fc764466d8ad1301cd312fdbd?v=1ff66a9be81348c79ae8eed07b507324) |\n| **포팅 메뉴얼**                | [바로가기](https://lab.ssafy.com/s06-s-project/S06P21S003/-/wikis/%ED%8F%AC%ED%8C%85-%EB%A9%94%EB%89%B4%EC%96%BC) |\n| **최종 발표 자료**             | [바로가기]()                                                 |\n| **프로젝트 서비스 UCC**        | [바로가기]()                                                 |\n\n\n\n## 5️⃣ 프로젝트 결과\n\n','ㄷㅜㅋㅗㅇ (Docong)','http://k6c104.p.ssafy.io/images/projectImg/1dd16766-2cd2-49da-a90c-8ac22419933b_KakaoTalk_20220518_141129310.png','두콩 (Docong)','2022-05-19 12:00:00.695680','W7KSeTIbp85TDdfSAWC93bjr+6oocLDaXSvf+6rAzbM='),(4,'특화','2022-05-18 14:13:39.774437','','https://github.com/khyunchoi/Rikey',146,'RIDE + BIKE = RIKEY','# 나의 라이딩 메이트, RIKEY ?\n\n> RIDE + BIKE = RIKEY ?\n\n![rikey_logo](https://github.com//khyunchoi/Rikey/raw/master/README.assets/rikey_logo.png)\n\n\n## 프로젝트 소개\n\n* 프로젝트명: RIKEY\n* 개발 기간: 2022.02.21 ~ 2022.04.08\n* 서비스 특징 및 주요기능\n  - 오늘의 날씨, 라이딩 안전 수칙 등의 정보 제공\n  - 내 위치를 기준으로 가까운 자전거 코스 추천\n  - 주행 시간, 주행 거리, 소모 칼로리 등의 주행 정보 관리 기능\n  - 실시간 주변 편의시설 정보 제공\n  - 라이더 모집, 자유 게시판 등의 커뮤니티 서비스 제공\n* 주요 기술\n  - React Native\n  - Spring boot\n  - JPA\n  - Rest API\n  - MySQL\n\n\n\n\n## 목차 \n\n[**1.팀소개**](#1-팀소개-)\n\n[**2.프로젝트 소개**](#2-프로젝트-소개-)\n\n   - 홈\n   - 프로필\n   - 주행\n   - 코스 추천\n   - 주변 편의시설\n   - 커뮤니티\n\n   \n\n[**3.프로젝트 명세**](#3-프로젝트-명세-)\n\n   - 아키텍처\n   - ERD\n   - UI 프토로타입\n   - API 명세서\n   - 요구사항 명세서   \n\n## 1. 팀소개 ?\n\n> 팀명 : 한사랑개발회?\n\n\n\n\n### ?‍♂️ Front-end\n\n- 김형준: 네이버 소셜 로그인, 회원가입, 홈화면, 사용자 정보 상태관리, 실시간 GPS를 통한 날씨 API 사용, 프로필 구현, 개인정보 변경 페이지 구현\n- 정동균: 커뮤니티 보드 조회, 카테고리별 보드제공, Article CRUD, Comment CRUD, 게시글 검색, 좋아요 로직 구현\n- 정우철: 주행정보 기록, 편의시설 위치 표시, 주행 정보 기반 칼로리 산출, 하버사인 공식을 사용한 주행 거리 산출, 주변 자전거길 표시, 자전거길 리뷰\n\n### ?‍♀️ Back-end\n\n- 김홍중: DB설계, 코스 리뷰 및 커뮤니티 댓글 CRUD API 개발\n- 장영하: 하버사인 공식을 이용한 실시간 편의시설 검색 기능, 게시판 CRUD API 개발, Nginx를 이용한 이미지 저장 기능 구현\n- 최강현: 사용자 인증 및 프로필 관련 API 개발, Hadoop을 이용한 자전거 편의시설 데이터 분산처리, Nginx를 이용한 EC2 서버 배포\n\n\n\n\n## 2. 프로젝트 소개 ?\n\n>라이키와 함께 자전거 여행을 떠나보세요!\n>\n>내 주변 가까운 인기 자전거 코스를 추천받고, 코스를 추천할 수 있습니다! :)\n>\n>실시간 주행정보를 확인하고, 가까운곳의 화장실, 편의점, 자전거 보관소 등의 편의시설 검색도 가능합니다!\n>\n>라이더 모집 게시판을 통해 같이 자전거를 탈 라이더들을 모아 단체 라이딩도 즐겨보세요 ?\n\n\n\n### 2.1 홈\n\n![KakaoTalk_20220406_214343893](https://github.com//khyunchoi/Rikey/raw/master/README.assets/KakaoTalk_20220406_214343893.gif)\n\n- 오늘의 날씨 정보(기온, 습도, 풍속, 날씨)를 제공합니다.\n\n-  매일 새로운 자전거 안전 수칙을 제공해 더 안전하고 올바른 라이딩 생활을 도와줍니다.\n\n  \n\n### 2.2 프로필\n\n![KakaoTalk_20220406_214343893_01](https://github.com//khyunchoi/Rikey/raw/master/README.assets/KakaoTalk_20220406_214343893_01.gif)\n\n- 내 프로필사진과 소개말, 이름과 지역을 보여주고 `편집버튼`을 누르면 개인정보 수정이 가능합니다. 이 페이지에서 로그아웃과 탈퇴가 가능합니다.\n- 지금까지의 라이딩 기록을 기반으로 누적 칼로리, 누적 거리, 누적 시간을 계산해서 보여줍니다.\n- `내가 쓴 글`, `내가 쓴 댓글`, `내가 쓴 코스 후기`, `나의 주행 기록`을 볼 수 있습니다.\n\n\n\n### 2.3 주행\n\n![KakaoTalk_20220406_214343893_02](https://github.com//khyunchoi/Rikey/raw/master/README.assets/KakaoTalk_20220406_214343893_02.gif)\n\n![KakaoTalk_20220407_173143478](https://github.com//khyunchoi/Rikey/raw/master/README.assets/KakaoTalk_20220407_173143478.gif)\n\n- 네비게이션바의 지도 모양의 버튼을 누르면 현재 내 주변의 자전거 코스를 추천해줍니다.\n- 코스를 누르면 해당 코스의 점수, 정보, 설명, 코스 후기들을 볼 수 있고 코스 후기 작성도 가능합니다.\n- `주행 시작` 버튼을 누르면 주행 기록이 시작되고 내가 지나온 길을 트래킹해줍니다.\n\n\n\n### 2.4 주변 편의시설\n\n![KakaoTalk_20220406_214343893_03](https://github.com//khyunchoi/Rikey/raw/master/README.assets/KakaoTalk_20220406_214343893_03.gif)\n\n- 자전거보관소, 편의점, 공공화장실 중 원하는 편의시설을 선택하면 내 주변 반경 10km 이내에 있는 편의시설이 검색됩니다.\n\n- 검색된 편의시설을 누르면 오픈시간, 자전거 공기주입기 여부 등의 상세 정보를 볼 수 있습니다.\n\n  \n\n### 2.5 커뮤니티\n\n![KakaoTalk_20220406_214343893_04](https://github.com//khyunchoi/Rikey/raw/master/README.assets/KakaoTalk_20220406_214343893_04.gif)\n\n- 칼로리별, 누적거리별, 누적시간 별 나의 랭킹을 보여줍니다.\n- 라이키 회원들이 쓴 게시글을 볼 수 있습니다. 가장 위의 3개의 게시글은 가장 조회수가 높은 게시글이 보여지게 됩니다.\n-  필터를 걸면 라이더(같이 자전거 탈 사람) 모집, 자유 게시판으로 나누어서 볼 수 있습니다.\n- 상단의 `돋보기` 버튼을 통해 해당 단어가 들어간 게시글을 검색할 수 있습니다.\n- 게시글을 누르면 해당 게시글의 디테일 페이지로 이동합니다.\n- 디테일 페이지에서는 `하트` 버튼을 통해 좋아요를 등록할 수 있고 댓글도 작성할 수 있습니다.\n- 하단의 `연필` 버튼을 누르면 글작성 페이지로 이동합니다.\n- 제목과 내용, 사진을 첨부해서 게시글을 작성할 수 있습니다.\n\n\n\n## 3. 프로젝트 명세 ?\n\n### 3.1 아키텍처\n\n![서비스_아키텍처](https://github.com//khyunchoi/Rikey/raw/master/README.assets/서비스_아키텍처.png)\n\n\n\n### 3.2 ERD\n\n![erd](https://github.com//khyunchoi/Rikey/raw/master/README.assets/erd.png)\n\n\n\n### 3.3 UI 프로토타입\n\n> [ UI Prototype](https://www.figma.com/file/YZbTWMzc69LeCoL98ZLeix/rikey?node-id=0%3A1)\n\n![프로토타입](https://github.com//khyunchoi/Rikey/raw/master/README.assets/프로토타입.png)\n\n\n\n### 3.4 API 명세서\n\n![api_명세서](https://github.com//khyunchoi/Rikey/raw/master/README.assets/api_명세서.png)\n\n### 3.5 요구사항 명세서\n\n| 순번 | 분류           | 요구사항 코드 | 요구사항명              | 요구사항 설명                                                | 우선순위 |\n| ---- | -------------- | ------------- | ----------------------- | ------------------------------------------------------------ | -------- |\n| 1    | 메인 (F01)     | F01-1         | 메인 화면               | 선택한 지역의 날씨 정보(날씨, 기온, 습도, 풍속, 구름)과 자전거 안전 수칙을 보여 준다. | ⭐⭐⭐      |\n| 2    | 회원 (F02)     | F02-1         | 회원가입                | 닉네임과 지역(전체 시)을 선택한다.                           | ⭐⭐⭐      |\n| 3    |                | F02-2         | 로그인                  | 카카오 소셜 로그인을 통해 간편 로그인을 한다.                | ⭐⭐⭐      |\n| 4    |                | F02-3         | 로그아웃                | 로그아웃을 한다.                                             | ⭐⭐⭐      |\n| 5    |                | F02-4         | 프로필 조회(My)         | 이름, 닉네임, 소개, 지역, 주간 소비 칼로리/주행거리/주행시간, 내가 쓴 글/댓글/코스 후기를 보여 준다. | ⭐⭐⭐      |\n| 6    |                | F02-5         | 프로필 조회(Other)      | 이름, 닉네임, 소개, 지역, 주간 소비 칼로리/주행거리/주행시간, 채팅 초대 버튼을 보여준다. | ⭐⭐⭐      |\n| 7    |                | F02-6         | 주행기록 상세 조회      | 회당 소비 칼로리/주행거리/주행시간 목록을 보여준다.          | ⭐⭐       |\n| 8    |                | F02-6         | 회원 정보 수정/탈퇴     | 프로필 이미지, 닉네임, 소개, 지역을 수정하거나 회원을 탈퇴한다. | ⭐⭐       |\n| 9    | 커뮤니티 (F03) | F03-1         | 프로필 정보             | 주간 랭킹, 주간 소비 칼로리, 주행거리, 주행시간을 보여 준다. | ⭐⭐⭐      |\n| 10   |                | F03-2         | 최근 게시글 조회        | 최근 올라온 게시글 리스트를 보여 준다.                       | ⭐⭐⭐      |\n| 11   |                | F03-3         | 게시글 조회             | 전체/자유/모집 게시판을 선택하면 해당 전체 게시글을 보여 준다. | ⭐⭐⭐      |\n| 12   |                | F03-4         | 게시글 상세 조회        | 게시글을 누르면 게시글 상세 페이지로 이동하고 상세 정보를 보여 준다. | ⭐⭐⭐      |\n| 13   |                | F03-5         | 게시글 작성             | 제목, 내용, 사진을 포함해서 게시글을 작성한다.               | ⭐⭐⭐      |\n| 14   |                | F03-6         | 게시글 수정/삭제        | 게시글을 작성한 작성자 만이 게시글을 수정/삭제할 수 있다.    | ⭐⭐⭐      |\n| 15   |                | F03-7         | 댓글 작성               | 한 게시글에 댓글을 작성한다.                                 | ⭐⭐⭐      |\n| 16   |                | F03-8         | 댓글 수정/삭제          | 댓글을 작성한 작성자 만이 댓글을 수정/삭제할 수 있다.        | ⭐⭐       |\n| 17   |                | F03-9         | 좋아요                  | 한 게시글에 좋아요를 등록하거나 취소한다.                    | ⭐⭐       |\n| 18   | 메신저 (F04)   | F04-1         | 메시지 리스트           | 전체 채팅 리스트를 보여준다.                                 | ⭐        |\n| 19   |                | F04-2         | 1:1 채팅                | 1:1로 메시지를 주고 받을 수 있다.                            | ⭐        |\n| 20   |                | F04-3         | 그룹 채팅               | 그룹으로 메시지를 주고 받을 수 있다.                         | ⭐        |\n| 21   |                | F04-4         | 그룹 채팅 초대          | 그룹에 사용자를 초대 한다.                                   | ⭐        |\n| 22   |                | F04-5         | 채팅 삭제               | 채팅을 나간다.                                               | ⭐        |\n| 23   | 주행 (F05)     | F05-1         | 주행 정보 기록 시작     | 현재 위치에서 주행정보 기록을 시작한다.                      | ⭐⭐⭐      |\n| 24   |                | F05-2         | 주행 정보 기록 일시정지 | 현재 위치에서 주행정보를 일시 정지한다.                      | ⭐⭐⭐      |\n| 25   |                | F05-3         | 주행 정보 기록 재개     | 현재 위치에서 주행정보를 재개한다.                           | ⭐⭐⭐      |\n| 26   |                | F05-4         | 주행 정보 저장          | 현재 위치에서 주행정보를 중단하고 저장한다. (누적 및 DB 저장) | ⭐⭐⭐      |\n| 27   | 코스정보 (F06) | F06-1         | 코스 리스트             | 내 주변에 있는 추천 코스들을 리스트로 보여 준다.             | ⭐⭐⭐      |\n| 28   |                | F06-2         | 코스 상세 정보          | 코스를 누르면 코스 상세 페이지로 이동하고 상세 정보와 후기를 보여 준다. | ⭐⭐⭐      |\n| 29   | 코스후기 (F07) | F07-1         | 코스 후기 작성          | 별점과 함께 후기를 남긴다.                                   | ⭐⭐⭐      |\n| 30   |                | F07-2         | 코스 후기 수정/삭제     | 후기를 작성한 작성자 만이 후기를 수정/삭제 할 수 있다.       | ⭐⭐       |\n| 31   | 편의시설 (F08) | F08-1         | 공공화장실              | 공공 화장실의 정보를 제공한다.                               | ⭐⭐⭐      |\n| 32   |                | F08-2         | 편의점                  | 편의점의 정보를 제공한다.                                    | ⭐⭐⭐      |\n| 33   |                | F08-3         | 자전거보관소            | 자전거 보관소의 정보를 제공한다.                             | ⭐⭐⭐      |\n| 34   |                | F08-4         | 설정                    | 설정에서 제공받을 정보를 선택해서 보여 준다.                 | ⭐⭐⭐      |\n| 35   |                | F08-5         | 상세정보                | 클릭(선택)한 편의시설의 상세정보를 제공한다.                 | ⭐⭐⭐      |\n\n','RIKEY','http://k6c104.p.ssafy.io/images/projectImg/be6f880f-62ea-4f64-9995-00f477338425_211D095054923B4B11.jpg','RIKEY','2022-05-19 12:32:22.245881','hDIZF3paN1HjNuuivtZ9W2bzsYqPa6o8WJQLBEyr2uo='),(5,'관통','2022-05-18 14:15:13.025662','','https://github.com/eunseo130/MovieApp',11,'음식 기반 영화 추천 서비스입니다','# SSAFYATER?\n\n## 팀 소개??‍???‍?\n\n- 프론트엔드 : 정우철(팀장)\n\n- 백엔드 : 김은서\n\n  \n\n## 기술 스택?\n\n![stack](https://github.com//eunseo130/MovieApp/raw/master/README.assets/stack.png)\n\n## 프로젝트 컨셉?\n\n- SSAFYATER = SSAFY + THEATER\n\n- 혼밥족 증가\n\n- 저녁 친구가 되어주는 영화\n\n- 음식에 따른 영화 추천\n\n  \n\n## 기능 구현?\n\n- 반응형 웹\n- 영화 검색\n- 영화 추천 \n- 게시판\n- 평점 및 좋아요\n\n\n\n## 영화 추천 알고리즘?\n\n- 음식 종류 기반 영화 장르 분류\n- 선택한 음식 기반 영화 10개 추천\n\n\n\n## ERD\n\n![ERD](https://github.com//eunseo130/MovieApp/raw/master/README.assets/ERD.png)\n\n\n\n## Flow Diagram\n\n![Flowdiagram](https://github.com//eunseo130/MovieApp/raw/master/README.assets/Flowdiagram.png)\n\n\n\n## UI\n\n![UI](https://github.com//eunseo130/MovieApp/raw/master/README.assets/UI.png)\n','SSAFYATER','http://k6c104.p.ssafy.io/images/projectImg/fd3f53fd-f59e-48b4-94dc-235563692108_001.png','SSAFYATER','2022-05-19 10:39:16.328064','qrdb2PBV/AcIthoFenbgKyoflBSvCPAwb+1JOLyb28k='),(6,'공통','2022-05-18 14:19:00.442869','','https://github.com/khyunchoi/FANTALK',16,'코로나 19로 인해 오프라인 팬미팅을 하지 못하는 기획사와 팬들을 위한 1:1 실시간 팬미팅 서비스','# 웹(웹 기술) 프로젝트\n\n## 카테고리\n\n| Application | Domain | Language | Framework |\n| ---- | ---- | ---- | ---- |\n| :white_check_mark: Desktop Web | :black_square_button: AI | :white_check_mark: JavaScript | :white_check_mark: Vue.js |\n| :black_square_button: Mobile Web | :black_square_button: Big Data | :black_square_button: TypeScript | :black_square_button: React |\n| :black_square_button: Responsive Web | :black_square_button: Blockchain | :black_square_button: C/C++ | :black_square_button: Angular |\n| :black_square_button: Android App | :black_square_button: IoT | :black_square_button: C# | :black_square_button: Node.js |\n| :black_square_button: iOS App | :black_square_button: AR/VR/Metaverse | :black_square_button: Python | :black_square_button: Flask/Django |\n| :black_square_button: Desktop App | :black_square_button: Game | :white_check_mark: Java | :white_check_mark: Spring/Springboot |\n| | | :black_square_button: Kotlin | |\n\n<br>\n\n# ?FANTALK ?(by TIMEROOM)\n> 코로나 19로 인해 오프라인 팬미팅을 하지 못하는 기획사와 팬들을 위한 1:1 실시간 팬미팅 서비스\n>\n> [배포링크](https://i6c105.p.ssafy.io)\n>\n> 2022.01.10 ~ 2022.2.18 (약 6주)\n\n<br>\n\n## ?목차\n\n- [프로젝트 소개](#프로젝트-소개)\n  - [기획 의도](#기획-의도)\n  - [팀원 및 역할](#팀원-및-역할)\n  - [서비스 소개](#서비스-소개)\n  - [개발 그라운드 룰](#개발-그라운드-룰)\n- [프로젝트 디자인](#프로젝트-디자인)\n  - [Service Architecture](#service-architecture)\n  - [UI Design](#ui-design)\n  - [ERD Design](#erd-design)\n  - [REST API](#rest-api)\n- [주요 기능](#주요-기능)\n  - [포팅 매뉴얼](#포팅-매뉴얼)\n  - [주요 기능 목록 및 설명](#주요-기능-목록-및-설명)\n\n<br>\n\n## 프로젝트 소개\n\n### 기획 의도\n\n- **코로나 19 확산으로 인한 오프라인 팬미팅의 대체재로써 온라인 팬미팅이 필요!**\n\n![1](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/1.PNG)\n\n- **팬미팅 니즈를 중심으로한 STP 분석**\n\n![2](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/2-16450736353511.PNG)\n\n<br>\n\n### 팀원 및 역할\n\n![3](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/3.PNG)\n\n<br>\n\n### 서비스 소개\n\n#### ? 연예인과의 \'1:1 실시간 팬미팅\'\n\n- **사전에 부여받은 입장코드를 통해 연예인과 1:1 실시간 팬미팅**\n\n#### ? 팬들끼리의 소통창구 \'팬 커뮤니티\'\n\n- **팬미팅 후기 공유 및 같은 연예인을 좋아하는 팬들을 위한 팬 커뮤니티**\n\n<br>\n\n### 개발 그라운드 룰\n\n#### ? Git branch 전략\n\n- **master** : 라이브 서버에 제품으로 출시되는 브랜치\n- **name** : 현재 작업하고 있는 팀원의 브랜치\n  - ex) hongjung\n- **hotfix** : master 브랜치에서 발생한 버그를 수정하는 브랜치\n- **commit message rule**\n  - \'날짜 기능명-작업종류 [간단한 작업 내용]\'\n    - ex) \'0119 signup-create [...]\'\n    - ex) \'0120 signup-hotfix [...]\'\n- 한번 merge된 브랜치는 삭제하고 재생성해서 작업\n\n#### ? BE\n\n- SOLID를 기반으로 객체 지향 설계 추구\n- DAO는 JPA Repository를 사용, DTO를 만들어 Entity로 직접 API 통신을 송수신 하지 않음\n- 주석을 통해 개발 내용을 공유\n\n#### ? FE\n\n- 사용자 경험을 최우선시함\n- 일관된 색과 디자인을 추구\n\n<br>\n\n## 프로젝트 디자인\n\n### Service Architecture\n\n>주요 기술 스택\n>\n>실시간 영상 서비스의 빠른 구축을 위해 WebRTC, Kurento, Stun, Turn 등이 결집된 오픈소스 플랫폼 \'OpenVidu\'를 이용\n>\n>OpenVidu의 카메라 권한이 Https에서만 허용되기 때문에 \'Nginx\'를 이용하여 SSL 설정\n>\n>개발의 생산성을 위해 \'Jenkins\'를 이용하여 자동 빌드 및 배포를 실행\n>\n>\'Jira\'를 이용하여 애자일 개발을 지향하려고 노력(스프린트 주기 설정, 백로그 관리 등)\n\n![service_architecture](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/service_architecture.PNG)\n\n<br>\n\n### UI Design\n\n#### ? Color Palette\n\n- **22년 올해의 팬톤 컬러인 \'베리 페리\'를 중심으로 Color Palette 설계**\n\n![4](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/4.PNG)\n\n#### ? UI\n\n- **Figma를 이용하여 UI Design**\n\n- **메인 페이지 & 회원 관리 페이지**\n\n![6](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/6-16450746642512.PNG)\n\n- **팬 커뮤니티 페이지**\n\n![7](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/7.PNG)\n\n- **팬미팅 신청 페이지**\n\n![8](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/8.PNG)\n\n- **팬미팅 페이지**\n\n![9](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/9.PNG)\n\n<br>\n\n### ERD Design\n\n- **ERD Cloud를 이용하여 ERD 설계**\n\n![5](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/5.PNG)\n\n<br>\n\n### REST API\n\n- **Swagger을 이용하여 REST API 설계 및 정리**\n\n![10](https://github.com//khyunchoi/FANTALK/raw/master/README.assets/10.png)\n\n<br>\n\n## 주요 기능\n\n### 포팅 매뉴얼\n\n- [포팅 매뉴얼](https://lab.ssafy.com/s06-webmobile1-sub2/S06P12C105/-/tree/master/exec)\n- 설치 가이드\n\n````\n#git clone\n\n#backend\ncd backend-java\nsudo chmod +x ./gradlew\nsudo ./gradlew clean build\ncd ..\nsudo docker run -d --name timeroom-backend --network host timeroom/backend-spring-boot-docker\n\n# openvidu-server\ncd /opt/openvidu\n/sudo openvidu start\n```\n````\n\n- 포트 설정\n\n```\nufw allow ssh\nufw allow 80/tcp\nufw allow 443/tcp\nufw allow 3478/tcp\nufw allow 3478/udp\nufw allow 5044/tcp\nufw allow 9200/tcp\nufw allow 40000:65535/tcp\nufw allow 40000:65535/udp\nufw allow 9090/tcp # 젠킨스\nufw enable\n```\n\n<br>\n\n### 주요 기능 목록 및 설명\n\n#### ? 팬 커뮤니티\n\n- 올바른 팬덤 문화 형성과 기획사의 개입 최소화를 위해 FANTALK 운영진이 생성, 수정, 삭제를 관리\n- 각 게시글과 댓글에 대한 수정, 삭제는 작성한 회원만 보이고 가능\n\n#### ? 1:1 실시간 팬미팅\n\n- 사전에 권한을 받은 기업회원만 팬미팅 신청 가능(FANTALK 운영진이 따로 권한을 부여)\n- 팬미팅은 해당 팬미팅을 신청한 기업회원만 수정, 삭제 가능\n- 팬미팅 신청이 완료되면 기업회원에게 입장 코드 목록을 제공 (FANTALK 운영진이 따로 메일을 통해 전달)\n- 팬미팅은 기업회원이 먼저 입장한 후에 일반회원이 입장 가능\n- 일반회원은 현재 진행 중인 팬미팅에는 입장이 불가능\n- 일반회원은 한번 사용한 입장코드 재사용 불가\n- OpenVidu API(Signal)를 이용하여 실시간 채팅 가능\n\n\n\n\n\n\n\n\n\n','FANTALK','http://k6c104.p.ssafy.io/images/projectImg/f5da4a02-7b45-4144-a415-6ddad8035431_FANTALK (1).png','FANTALK','2022-05-19 10:43:58.490207','hDIZF3paN1HjNuuivtZ9W2bzsYqPa6o8WJQLBEyr2uo='),(7,'공통','2022-05-18 14:23:58.546730','','https://github.com/DongKyunJung/Caffe-in',29,'카페인입니다.','<!-- 필수 항목 -->\n\n## 카테고리\n\n| Application | Domain | Language | Framework |\n| ---- | ---- | ---- | ---- |\n| :white_check_mark: Desktop Web | :black_square_button: AI | :white_check_mark: JavaScript | :black_square_button: Vue.js |\n| :white_check_mark: Mobile Web | :black_square_button: Big Data | :black_square_button: Html | :white_check_mark: React |\n| :white_check_mark: Responsive Web | :black_square_button: Blockchain | :black_square_button: C/C++ | :black_square_button: Angular |\n| :black_square_button: Android App | :black_square_button: IoT | :black_square_button: C# | :black_square_button: Node.js |\n| :black_square_button: iOS App | :black_square_button: AR/VR/Metaverse | :black_square_button: Python | :black_square_button: Flask/Django |\n| :black_square_button: Desktop App | :black_square_button: Game | :white_check_mark: Java | :white_check_mark: Spring/Springboot |\n| | | :black_square_button: Kotlin | |\n\n<!-- 필수 항목 -->\n\n## 프로젝트 소개\n\n* 프로젝트명: 카페(디저트) 큐레이션 기반 SNS\n* 서비스 특징: 웹/모바일(웹 디자인) 스켈레톤 프로젝트\n* 주요 기능\n  - 회원 관리\n  - 관심사로 등록된 피드 확인\n  - SNS 기능 (피드, 팔로우/언팔로우, 댓글, 좋아요)\n  - 지도를 통한 점포 가독성\n* 주요 기술\n  - JPA\n  - React\n  - JWT Authentication\n  - REST API\n  - Jenkins CI/CD\n* [참조 리소스](#참고사이트)\n* 배포 환경\n  - URL: http://i6c104.p.ssafy.io/\n  - 테스트 계정: \n\n<!-- 자유 양식 -->\n\n## 팀 소개\n* 박주한: 팀장, 프론트엔드 개발\n* 이승현: 부팀장, 백엔드 개발\n* 박소희: 백엔드 개발 \n* 서은민: 백엔드 개발\n* 정동균: 프론트엔드 개발\n* 유병재: 프론트엔드 개발\n\n<!-- 자유 양식 -->\n\n## 프로젝트 상세 설명\n### 기획 \n- **회원 가입**\n  - **자체 회원가입**\n    - 회원은 이메일을 입력후 이메일 인증을 한다.\n    - 이메일 중복 불가 \n    - 데이터 입력 후 이메일 인증 완료(이메일, 인증 코드를 서버에 넘겨서 코드가 일치해야함)\n    - 이메일 인증이 완료 되면 추가 데이터(비밀번호, 아이디, 프로필 사진, 관심사)를 입력받는다.\n      - 비밀번호는 영문+숫자+특수문자 모두 포함(최소 8자, 최대 15자)해야 한다.\n      - 비밀번호 확인도 필요 (이중 확인)\n      - 아이디 영문+숫자+특수문자(“_ , -, .”)(최소 4자, 최대 10자)(영문 or 숫자 필수 입력) 여야 한다.(중복 불가)\n      - 프로필 사진을 등록하지 않으면 null이 입력된다. (null일 경우 기본 이미지 제공)\n      - 관심사 카테고리 선택 (최소 0~3개 선택, 분위기/메뉴 상관없음)\n      - 데이터 입력 후 회원 가입 완료\n\n  - **SSO (OAuth. 네이버, 카카오, 구글 로그인)**\n    - 소셜 회원가입 버튼을 누른다.\n    - 해당 네이버,카카오,구글 아이디에서 받은 값을 이메일 값으로 회원가입한다.\n    - 소셜 회원가입을 하면 아이디가 임의로 생성되어 가입된다.\n    - 변경을 원할 시 회원 정보 수정을 이용하면 된다\n\n    <br>\n\n- **로그인**\n  - 이메일, 비밀번호 입력\n  - 이메일 기억하기 기능 존재\n  - 로그인 성공 시 access token과 refresh token이 발급되며, 로그인 이후 요청하는 모든 request의 헤더에 Bearer로 access token을 보내줘야함\n  - access token 만료 시 access token과 refresh token을 서버에 보내서 토큰을 재발급 받아야함\n\n    <br>\n\n- **비밀번호 찾기**\n  - 자제 회원가입을 한 회원만 이용 가능하다.\n  - 이메일 인증 후 임시 비밀번호 발급 후 로그인 후 비밀번호 변경\n\n    <br>\n\n- **계정** \n  - 아이디, 게시물 수 , 팔로워, 팔로잉 수, 소개 , 프로필 사진, 관심사, 본인이 작성한 피드(메인 이미지만 최신순으로) 조회된다.\n  - 로그인 하지 않았을 경우 위의 조회만 가능하다.\n  - 로그인한 회원일 경우 팔로워 / 팔로잉 수 클릭시 각각의 목록이 조회된다.\n    - 본인 계정일 경우\n      - 팔로워 목록 \n        - 아이디, 프로필 사진, 팔로잉 여부(true/false)\n        - 팔로우 / 삭제 (상대방이 나의 계정 언팔로우 시키기) 가능\n      - 팔로잉 목록 \n        - 고유번호,아이디, 프로필 사진\n        - 팔로우 / 언팔로우 \n    - 다른 회원의 계정일 경우\n      - 팔로워 / 팔로잉 목록 조회 시 아이디, 프로필 사진, 팔로잉 여부(true/false)가 조회된다.\n      - 목록에 있는 회원 각각 팔로우 / 언팔로우 할 수 있다.\n      - 다른 회원의 계정에서 해당 회원을 팔로우 / 언팔로우 할 수 있다. \n  - 로그인한 회원의 본인 계정일 경우\n    - 본인의 프로필 상세 조회(아이디, 프로필 사진, 소개 , 이메일)가 가능하다.\n    - 회원 정보 수정도 가능하다. \n\n    <br>\n\n- **회원정보 수정 / 탈퇴**\n  - 아이디, 프로필 사진, 소개, 관심사 수정이 가능하다.\n    - 아이디는 반드시 입력되어야 한다.\n    - 아이디 영문+숫자+특수문자(“_ , -, .”)(최소 4자, 최대 10자)(영문 or 숫자 필수 입력) 여야 한다.(중복 불가)\n    - 프로필 사진은 기본 프로필 사진으로도 변경이 가능하다.\n    - 관심사 카테고리 선택 (최소 0~3개 선택, 분위기/메뉴 상관없음) \n  - 자체 회원가입을 한 회원은 비밀번호 변경이 가능하다.\n    - 비밀번호는 영문+숫자+특수문자 모두 포함(최소 8자, 최대 15자)해야 한다.\n    - 비밀번호 확인도 필요 (이중 확인)\n  - 탈퇴\n\n    <br>\n\n- **피드 - 상세보기**\n  - 조회 : 파일, 작성자 프로필 사진, 아이디, 작성일, 내용, 카테고리, 카페명, 좋아요 수, 북마크 수, 댓글, 회원이 좋아요를 눌렀는지 여부\n    - 좋아요 수 클릭시 좋아요를 누른 회원 목록 조회\n    -   팔로우 목록 조회와 동일\n        - 프로필 사진, 아이디, 팔로우 여부\n        - 팔로우 / 언팔로우 가능\n    - 작성자 클릭시 작성자 계정으로 이동\n    - 카테고리 클릭시 검색 결과로 이동\n    - 카페명 클릭시 카페 검색결과로 이동\n  - 등록\n    - 이미지, 작성자 고유 번호(로그인시 받은 고유 번호), 카테고리, 내용, 카페 명\n      - 카페 정보와 카테고리는 선택\n  - 삭제\n    - 피드 고유번호, 작성자 고유 번호로 삭제\n    - 댓글까지 삭제됨\n  - 수정\n    - 이미지 수정\n      - 삭제된 이미지가 있을 경우 해당 이미지의 번호도 넘겨주어야 함\n    - 내용 수정\n    - 카테고리 수정\n    - 카페 수정\n  - 좋아요 / 좋아요 취소\n  - 북마크 / 북마크 취소\n\n    <br>\n\n* **댓글 (로그인한 회원만 사용 가능)**\n  * 등록\n    * 내용 작성 안 했을 시 등록 불가\n  * 조회\n    * 첫 번째 댓글\n      * 작성자 프로필 사진, 작성자 아이디, 내용, 작성일, 좋아요 수, 로그인한 회원이 좋아요 눌렀는지에 대한 여부 조회\n    * 대댓글\n      * 첫 번째 댓글과 동일하나 부모 댓글 작성자의 아이디가 함께 조회\n    * 좋아요 수 클릭시 좋아요를 누른 회원 목록 조회\n      * 누른 회원의 프로필 사진, 아이디, 로그인한 회원이 해당 회원을 팔로우 했는지에 대한 여부 조회 \n  * 삭제\n    * 첫 번째 댓글 삭제 시 대댓글도 전부 삭제\n    * 대댓글이 삭제됐을 시 해당 댓글만 삭제 \n  * 좋아요 / 좋아요 취소\n    * 빈 하트 클릭시 좋아요\n    * 채워진 하트 클릭시 좋아요 취소\n    \n      <br>\n\n- **메인 화면**\n  - 지도\n    - 내 위치 기반으로 주변 카페 검색\n    - 내 위치 제공 불허용 사용자일 경우 지도 초기 마커 기반으로 카페 검색\n    - 지도에 표시된 카페 선택 시 토글 생성\n      - 카페 정보 (카페 사진, 카페 이름, 카페 주소(위치). 메뉴 정보, 리뷰)\n      - 카페 키워드\n  - 피드\n    - 이미지\n      - 로그인 : 내가 선택한 카테고리 기반 + 내가 팔로우한 사람의 게시글 + 나의 게시글 최신순으로 조회\n      - 그 외 : 랜덤으로 피드가 보여짐\n        - 관심사, 팔로우한 사람, 내가 작성한 글 모두 없으면\n        - 로그인을 하지 않았을 경우 등\n      - 로그인 했을시 좋아요 / 좋아요 취소 가능 (여부 확인) - 로그인한 회원만 가능\n      - 좋아요 수\n    - 블로그\n      - 프로필 사진, 아이디, 카페명, 내용, 이미지, 카테고리, 좋아요 수\n      - 로그인 했을시 좋아요 / 좋아요 취소 가능 (여부 확인) - 로그인한 회원만 가능\n\n    <br>\n\n* **검색 (로그인한 회원만 사용 가능)**\n  * 검색창은 탭\n  * 장소 검색\n    * 검색 기반의 카페가 지도에 표시\n    * 동 검색\n      * 해당 동의 카페가 지도에 표시 및 해당 카페 목록이 노출\n  * 카테고리 검색\n    * 카테고리가 포함된 피드 목록 조회\n    * 정렬 기준은 인기순 / 최신순\n  * 카페 검색\n    * 해당 카페의 위치가 지도에 표시\n    * 카페의 상세 정보 확인 가능\n    * 해당 카페가 등록된 피드 목록 조회 <br>\n\n\n- **북마크 목록**\n  - 메인의 피드 화면과 동일\n\n- **좋아요 목록**\n  - 메인의 피드 화면과 동일\n\n\n\n___\n\n### 와이어프레임\n  ![와이어1](uploads/와이어프레임1.png) \n  ![와이어2](uploads/와이어프레임2.png)\n  ![와이어3](uploads/와이어프레임3.png)\n  ![와이어4](uploads/와이어프레임4.png)\n  ![와이어5](uploads/와이어프레임5.png)\n\n### ERD \n  ![ERD](uploads/caffe_in_erd.png)\n\n___\n\n### 참고사이트\n* 백엔드 [링크 모음 Notion](https://zany-perigee-3ef.notion.site/Backend-05bdeded90ed49098dc7956267d71195)\n\n* 프론트엔드\n  * 무한 스크롤 : https://ghur2002.medium.com/react%EC%97%90%EC%84%9C-infinite-scroll-%EA%B5%AC%ED%98%84%ED%95%98%EA%B8%B0-128d64ea24b5\n  * 스켈레톤 컴포넌트 : https://ui.toast.com/weekly-pick/ko_20201110\n  * axios, fetch : https://studyandwrite.tistory.com/368, https://dream-frontend.tistory.com/383\n  * 게시판 기능 : https://www.youtube.com/watch?v=EDBYFsbjZ9I&list=PLEzWjQvavJSoI1gF7cP-uxFyJQD2l47O3&index=8&ab_channel=%EC%BD%94%EB%94%A9%EA%B2%AC%ED%9E%88%EC%B9%98HeechCoding\n  * \n','CAFFE-IN','http://k6c104.p.ssafy.io/images/projectImg/f8069454-c4d5-41ae-8527-42bb2c219671_따봉.png','CAFFE-IN','2022-05-19 12:00:05.033612','I+if2+xAkX+z+OSbEjOk8ywiJFxLGmT90HYO7XmtnRk='),(9,'관통','2022-05-18 14:35:48.413214','','https://github.com/khyunchoi/MOVIEGG',25,'MOVIE GG는 다양한 방법으로 영화 추천을 제공합니다.','![](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/moviegg.png)\n\n\n\n## 목차?\n- [프로젝트 소개](#프로젝트-소개)\n- [Member](#member)\n- [역할](#역할)\n- [개발 가이드라인](#개발-가이드라인)\n- [스타일 가이드라인](#스타일-가이드라인)\n- [Tech Stack](#tech-stack)\n- [주요 기능 목록](#주요-기능-목록)\n- [ERD & UI](#erd-&-ui)\n- [캐릭터 고르기 알고리즘](#캐릭터-고르기-알고리즘)\n- [마무리 소감](#마무리-소감)\n\n<br>\n\n## 프로젝트 소개?\n\n>Welcome to the MOVIE GG <br>\n>MOVIE GG는 다양한 방법으로 영화 추천을 제공합니다. 당신만의 League of Legends 캐릭터를 고르고, 캐릭터에 어울리는 영화 추천을 받아보세요.\n\n<br>\n\n## Member?\n\n<table>\n  <tr>\n    <td align=\"center\"><a href=\"https://github.com/DongKyunJung\"><img src=\"https://avatars.githubusercontent.com/u/87457171?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>DONGKYUN</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/khyunchoi\"><img src=\"https://avatars.githubusercontent.com/u/77478732?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>GANGHYEON</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/HeoBeom\"><img src=\"https://avatars.githubusercontent.com/u/87457226?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>HEOBEOM</b></sub></a><br /></td>\n  </tr>\n</table>  \n\n<br>\n\n## 역할?‍♂️\n\n- **정동균** (팀장) : 영화 추천 알고리즘 설계 & 추천 기능 구현\n- **최강현** (기술 고문) : 메인페이지 설계 & 게시판 기능 구현\n- **허범** (PM) : 소셜 로그인 & 사용자 인증 기능 구현\n\n<br>\n\n## 개발 가이드라인?\n\n- 상시 회의를 통해 프로젝트의 완성도를 높입니다.\n  - 평일은 9 to 6까지 필수, 이후 저녁에도 틈틈이 모여서 개발하기\n  - 주말은 하루는 쉬고 하루 열심히 달리기??\n- 정해진 Git branch 전략을 통해 협업의 일관성을 유지합니다.\n\n![image-20211125114828069](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125114828069.png)\n\n- 개발 일정을 준수하며, 이슈가 있을 시에는 즉각 공유하여 신속하게 해결합니다.\n\n![image-20211125115733717](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125115733717.png)\n\n<br>\n\n## 스타일 가이드라인?\n\n- CSS 클래스 지정은 App 이름을 포함하여 충돌을 방지합니다.\n- 길이, 높이, 테두리 등 세부 사항은 사전에 만든 UI 프로토 타입을 기준으로 지정합니다.\n- 색은 사전에 만든 컬러 팔레트를 기준으로 지정합니다.\n\n![image-20211125115902511](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125115902511.png)\n\n<br>\n\n## Tech Stack?\n\n![image-20211125133431987](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125133431987.png)\n\n<br>\n\n## 주요 기능 목록?\n\n- 네이버, 카카오, 구글, 깃헙 계정과 연동한 소셜 로그인 기능\n- 이메일 인증을 통한 비밀번호 찾기 기능\n- 영화 및 게시판 검색 기능\n- 유저 레벨에 따른 권한 관리 기능\n- 영화진흥위원회 API, TMDB API, 크롤링 등을 이용한 영화 추천 기능\n- 캐릭터 고르기 테스트를 통한 영화 추천 기능\n\n<br>\n\n## ERD & UI✒\n\n- ERD (Erdcloud)\n\n![ERD](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/ERD.png)\n\n- UI (Figma)\n\n![UI1](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/UI1.png)\n\n![UI2](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/UI2.png)\n\n![UI3](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/UI3.png)\n\n<br>\n\n## 캐릭터 고르기 알고리즘?\n\n- 영화 추천 알고리즘 계획\n\n![image-20211125140245580](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125140245580.png)\n\n- 캐릭터 선정 및 장르 부여\n\n![image-20211125140721834](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125140721834.png)\n\n- 질문 선정\n\n![image-20211125141010035](https://github.com//khyunchoi/MOVIEGG/raw/master/README.assets/image-20211125141010035.png)\n\n- 질문 정리\n\n<img src=\"README.assets/image-20211125140910045.png\" alt=\"image-20211125140910045\" style=\"zoom: 80%;\" />\n\n<br>\n\n## 마무리 소감?\n\n- 정동균 : 하루 종일 즐겁게 이야기하며 재미있게 프로젝트를 진행 하다 보니 프로젝트에도 욕심이 나고 투자하는 시간도 많아 졌던것 같았습니다. 혼자 하는 개발이 아닌 함께 협업하며 발생하는 오류나 시행착오들을 함께 해결해 나가는 과정이 함께 이기 때문에 더 즐겁고 수월 했던 것 같습니다. 아이디어가 많았는데 다 구현하지 못하는 기술적 한계가 아쉬워서 오늘부터 생각한 대로 만들 수 있는 실력을 갖추기 위해 더 정진 해야겠습니다.\n- 최강현 : 좋은 팀원을 만나서 일주일 동안 즐겁게 프로젝트 할 수 있었습니다. 하다보니 자꾸 욕심이 생기는데 구현할 수가 없어서 실력을 더 키워야겠다는 생각을 했습니다.\n- 허범 : 같이 하고 싶은 팀원들과 함께 프로젝트를 할 수 있어서 일주일이 금방 지났습니다. 서로 막히는 부분이 있으면 공유하면서 문제를 해결하는 것이 함께하는 개발임을    느낄 수 있었고, 더욱 개발실력 또한 키워야겠다고 생각이 든 일주일이었습니다.\n','MOVIEGG','http://k6c104.p.ssafy.io/images/projectImg/ddbab2f6-d8a5-4f62-beba-7299198d25fe_moviegg.png','MOVIEGG','2022-05-19 11:59:29.085425','hDIZF3paN1HjNuuivtZ9W2bzsYqPa6o8WJQLBEyr2uo='),(10,'토이','2022-05-18 14:52:17.124017','','https://github.com/khyunchoi/PODO-project',33,'주니어 개발자들을 위한 협업툴','# PODO ? \n주니어 개발자들을 위한 협업툴 `PODO`!  \n생애 첫 개발 프로젝트를 포도와 함께 하세요 ?\n\n</br>\n\n![마스코트](https://github.com//khyunchoi/PODO-project/raw/master/README.assets/마스코트-1637077278149.png)  \n\n## ?‍♂️ 프로젝트 소개 ?‍♀️\n\n>초등학교 첫 여름방학, 포도가 그려진 종이 한 장에 한 알 한 알 스티커를 붙이며 설레는 마음으로 숙제를 제출하던 그 순간을 떠올렸습니다.\n>이제는 혼자가 아닌 주니어 개발자들이 열매를 한 알 한 알 맺을 수 있도록 돕는 프로젝트 협업툴입니다.  \n\n</br>\n\n## ? Member\n\n<table>\n  <tr>\n    <td align=\"center\"><a href=\"https://github.com/woosteelz\"><img src=\"https://avatars.githubusercontent.com/u/48507475?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>WOOCHEOL</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/yeongsummer\"><img src=\"https://avatars.githubusercontent.com/u/87457128?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>YEONGHA</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/DongKyunJung\"><img src=\"https://avatars.githubusercontent.com/u/87457171?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>DONGKYUN</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/khyunchoi\"><img src=\"https://avatars.githubusercontent.com/u/77478732?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>GANGHYEON</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/hongjungkimm\"><img src=\"https://avatars.githubusercontent.com/u/87457152?v=4\" width=\"100px;\" alt=\"\"/><br /><sub><b>HONGJUNG</b></sub></a><br /></td>\n  </tr>\n</table>  \n\n</br>\n\n## ??‍?‍?? 역할\n\n- **정우철** (팀장)  : 채팅 기능 구현\n- **장영하** (부팀장)  : 일정 & 검색 기능 구현\n- **정동균** (UI 디자인 총괄)  : 워크스페이스 & 카테고리 기능 구현\n- **최강현** (기술 고문) : 소셜 로그인 & 사용자 인증 기능 구현\n- **김홍중** (PM) : 칸반 보드 & 게시글 기능 구현  \n\n</br>\n\n## ? 개발 가이드라인\n\n- 정기 및 상시 회의를 통해 프로젝트의 완성도를 높입니다.\n- 개발 일정을 준수하며, 이슈가 있을 시에는 즉각 공유하여 신속하게 해결합니다.\n\n- 상세한 주석을 통해 코드의 이해도를 높입니다.\n- 정해진 Git branch 전략을 통해 협업의 일관성을 유지합니다.  \n\n</br>\n\n## ? 스타일 가이드라인\n\n- `podo`는 사용자가 보고 느끼는 경험을 최우선으로 합니다.\n\n- 클래스 지정은 App 이름을 포함하여 충돌을 방지합니다.\n\n- 길이, 높이, 테두리 등 세부사항은 사전에 만든 UI 프로토 타입을 기준으로 지정합니다.\n\n- 색은 사전에 만든 컬러 팔레트를 기준으로 지정합니다.\n\n- **Color Palette**\n\n<img src=\"README.assets/colors.PNG\" alt=\"colors\"  />  \n\n</br>\n\n## ? Tech Stack\n\n![made_by_woosteelz](https://github.com//khyunchoi/PODO-project/raw/master/README.assets/made_by_woosteelz.jpg)  \n\n</br>\n\n## ? 주요 기능 목록\n\n- 네이버, 카카오, 구글, 깃헙 계정과 연동한 소셜 로그인 기능\n- 이메일 인증을 통한 비밀번호 찾기 기능\n- 비회원 초대 이메일 발송 기능\n- 사용자 그룹 생성 및 초대 기능\n- 워크스페이스별 단체 채팅 기능\n- 드래그 앤 드롭 칸반 보드 기능\n- Summernote 라이브러리 기반 텍스트 편집 기능\n- Calendar 라이브러리 HTML Calendar 기반 일정 기능  \n\n</br>\n\n## ? UI & ERD\n\n- **ERD** **(Erdcloud)**\n\n![image](https://user-images.githubusercontent.com/87457128/141805782-3eae09db-0d80-4f25-a322-28ed8de3ff3b.png)  \n\n\n\n- **UI** **(Figma)**\n\n![UI1](https://github.com//khyunchoi/PODO-project/raw/master/README.assets/UI1.png)\n\n![UI2](https://github.com//khyunchoi/PODO-project/raw/master/README.assets/UI2.png)  \n\n</br>\n\n## ? 프로젝트 마무리 소감\n\n- **정우철** : \n- **장영하** :\n- **정동균** :\n- **최강현** :\n- **김홍중** :\n','PODO','http://k6c104.p.ssafy.io/images/projectImg/6a169ec8-9293-4543-ad63-cccfa6ad3523_Rectangle 32.png','PODO','2022-05-19 11:59:25.886324','hDIZF3paN1HjNuuivtZ9W2bzsYqPa6o8WJQLBEyr2uo='),(14,'공통','2022-05-18 17:46:33.529475','','https://github.com/eunseo130/DeNS',9,'개발자 프로젝트 팀 구성을 위한 페이지입니다','# DeNS\n\n> 개발자 팀 구성을 위한 사이트\n\n1. 일정 : 2021.01.10 - 2021.02.18 (총 7주)\n\n2. 인원 (총 6인)\n\n   - 윤설 : 팀장, Frontend\n   - 김은서 : Backend\n   - 김준우 : Backend\n   - 김형준 : Frontend\n   - 서예진 : Backend\n   - 이승규 : Frontend\n\n3. 기술 스택\n\n   - Frontend : React\n   - Backend : Spring, Java, Redis\n   - Infra : Jenkins\n   - DB : MySQL\n\n4. 아키텍처\n\n   ![dens_architecture](https://github.com//eunseo130/DeNS/raw/master/README.assets/dens_architecture.PNG)\n\n5. 주요 기능\n  ![page1](https://github.com//eunseo130/DeNS/raw/master/README.assets/page1.png)\n\n​	![page2](https://github.com//eunseo130/DeNS/raw/master/README.assets/page2.png)\n\n','DeNS','http://k6c104.p.ssafy.io/images/projectImg/35c31f3a-e905-40ee-9e67-d97b8e4a6036_002 (2).png','DeNS','2022-05-19 11:59:17.895836','qrdb2PBV/AcIthoFenbgKyoflBSvCPAwb+1JOLyb28k='),(16,'관통','2022-05-19 10:33:04.312526','','https://github.com/hyunse0/Mood-of-Movie',13,'당신의 원하는 분위기의 영화를 찾아드립니다!','# ✨ Mood-of-Movie ✨\n? 삼성청년SW아카데미 1학기 관통 프로젝트 최우수상(1등) ?\n\n\n\n## 목차\n- [프로젝트 소개](#프로젝트-소개)\n\n- [프로젝트 명세](#프로젝트-명세)\n  \n  - [개발 환경](#개발-환경)\n  - [개발 일정](#개발-일정)\n  - [ERD](#ERD)\n  - [UI 프로토타입](#UI-프로토타입)\n  - [추천 알고리즘](#추천-알고리즘)\n  \n- [주요 기능](#주요-기능)\n\n  - [accounts](#accounts)\n  - [movies](#movies)\n\n  \n## 프로젝트 소개\n> 코로나때문에 놀러다니지도 못하고... 집에서 힐링할 수 있는 방법 없을까?\n\n\n\n간단하게 힐링하고 싶을 때 영화 감상 어떠세요?\n\n보고 싶은 영화를 찾는데 너무 오래걸린다거나 막상 영화를 본 후 원하던 영화가 아니라서 실망하지 않도록\n\n**Mood of Movie**가 쉽고 빠르게 당신이 원하는 분위기의 영화를 찾아드립니다!\n\n\n\n### 팀원\n\n| <img src=\"https://avatars.githubusercontent.com/u/87457128?v=4\" alt=\"image-yeongha\" style=\"zoom:40%;\" /> | <img src=\"https://avatars.githubusercontent.com/u/78924207?v=4\" alt=\"image-hyunseo\" style=\"zoom:40%;\" /> |\n| :----------------------------------------------------------: | :----------------------------------------------------------: |\n|           [장영하](https://github.com/yeongsummer)           |             [하현서](https://github.com/hyunse0)             |\n|                데이터 수집, movies FE&BE 구현                |                     accounts FE&BE 구현                      |\n\n\n\n## 프로젝트 명세\n### 개발 환경\n\n![image-20211204204920462](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/image-20211204204920462.png)\n\n\n\n### 개발 일정\n\n- 2021.11.16 ~ 2021.11.26 (총 11일간)\n\n![image-20211204205026460](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/image-20211204205026460.png)\n\n\n\n### ERD\n\n![image-20211204205607867](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/image-20211204205607867.png)\n\n\n\n### UI 프로토 타입\n\n![img](https://www.notion.so/image/https%3A%2F%2Fs3-us-west-2.amazonaws.com%2Fsecure.notion-static.com%2Fde58fe2c-9eac-41b2-b16e-4abe07a0b931%2FUntitled.png?table=block&id=40a11754-c6d9-4094-a8f7-ca647ac726c9&spaceId=daa2d103-3ecd-4519-8c30-4f55e74c7ef4&width=2000&userId=15ddc9f1-f55d-4520-a0c8-7e7e99a76dbb&cache=v2)\n\n\n\n### 추천 알고리즘\n\n<img src=\"README.assets/image-20211204210127760.png\" alt=\"image-20211204210127760\" style=\"zoom:80%;\" />\n\n- 코사인 유사도\n  - 1 : 서로 완전히 같은 경우\n  - 0 : 서로 독립적인 경우\n  - -1 : 서로 완전히 반대되는 경우\n  - 크기가 아닌 각도를 사용하여 컬럼 간의 데이터 양이 차이나거나 데이터가 부족한 경우에 유용\n\n![image-20211204210511260](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/image-20211204210511260.png)\n\n\n\n## 주요 기능\n\n### ?‍♀️ accounts\n\n\n\n#### **[로그인 & 로그아웃]**\n\n![login](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/login.gif)\n\n\n\n- 네비게이션 바의 아이콘 누르면 다이얼로그 실행\n- 필수 입력 값이 누락되면 사용자에게 표시\n- 비밀 번호를 텍스트로도 확인 가능\n- 로그인 성공 시 메인페이지 이동\n- 로그인 실패 시 alert 생성\n<br>\n\n\n#### **[회원 가입]**\n\n![signup](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/signup.gif)\n\n- 회원 가입 유효성 검사 구현\n  - 아이디 : 이메일\n  - 닉네임 : 특수문자 불가\n  - 비밀 번호 : 숫자와 영어를 포함한 6-15 글자\n<br>\n\n\n#### **[프로필 페이지]**\n\n![profile_image](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/profile_image.gif)\n\n![follow](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/follow.gif)\n\n- 프로필 사진, 팔로우/팔로잉, 찜한 영화, 작성한 리뷰\n- 본인의 프로필 페이지일 경우, **정보 수정** 가능 (사진 업로드, 비밀번호 변경)\n  - 사진 업로드 : 2MB 이하로 제한\n  - 비밀번호 변경 : 기존 비밀번호 일치 여부 확인, 새 비밀번호 일치 여부 확인\n- 타인의 프로필 페이지일 경우, **팔로우** 가능\n  - 이미 팔로우 되어있다면 언팔로우, 아니라면 팔로우 버튼이 보임\n  - 숫자를 클릭하면 팔로우/팔로잉 리스트 출력\n  - 리스트에서 유저 닉네임을 클릭하면 해당 유저의 프로필 페이지로 이동\n<br>\n\n\n### ? movies\n\n\n\n#### **[인기 영화]**\n\n![ranking](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/ranking.gif)\n\n- 현재 TOP 20 인기 영화 정보 제공 (매일 새로 정보 갱신)\n- 영화 카드를 누르면 해당 영화 상세 정보 다이얼로그 실행\n- 영화 카드에 있는 하트 아이콘을 통해 영화 좋아요 기능 제공\n-  영화 상세 정보 모달의 \'리뷰 보러 가기\' 버튼 누르면 해당 영화의 리뷰 리스트 페이지로 이동\n<br>\n\n\n#### **[추천 & 검색]**\n\n![recommend_3](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/recommend_3.gif)\n\n![recommend_4](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/recommend_4.gif)\n\n- 검색 자동 완성 기능 제공\n- 검색어가 포함된 영화 제목 리스트 제공\n- 인생 영화 제목을 입력하면 유사한 영화 10개 추천\n- 최신 트렌드에 따라 바뀌는 5가지의 카테고리로 영화 추천\n<br>\n\n\n#### **[리뷰 & 댓글]**\n\n![review_list](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/review_list.gif)\n\n![add_review](https://github.com//hyunse0/Mood-of-Movie/raw/master/README.assets/add_review.gif)\n\n- 자동 완성 기능 제공\n- 검색 전에는 모든 리뷰 리스트 제공\n- 검색 후에는 검색한 영화의 리뷰 리스트만 제공\n- 툴 바의 연필 모양 아이콘을 클릭하면 리뷰 작성 폼으로 이동\n- 리뷰의 상세 정보 제공\n- \'작성자의 모든 리뷰 더보기\' 버튼 누르면 작성자의 프로필 페이지로 이동\n- \'수정 & 삭제\' 버튼은 작성자에게만 보임\n- 하트 아이콘을 통해 리뷰 좋아요 기능 제공\n- 댓글 폼 아래의 댓글 리스트가 자동으로 갱신\n','Mood of Movie','http://k6c104.p.ssafy.io/images/projectImg/7aa1ae49-7fd8-4afa-84cc-e01e996f1ef4_main_image.jpg','Mood of Movie','2022-05-19 11:59:12.442450','W7KSeTIbp85TDdfSAWC93bjr+6oocLDaXSvf+6rAzbM='),(17,'공통','2022-05-19 10:36:44.255484','','https://github.com/hyunse0/mogakgong',7,'온라인 독서실 모각공입니다!','# ✏ 모각공\n\nSSAFY 광주 2반 공통 프로젝트 4팀 <br>\n? Notion : https://www.notion.so/12c9091a166744c49b5990a32f56fc78\n<br>\n<br>\n\n### 프로젝트 소개\n\n- **프로젝트 기간**\n  2022.01.10 ~ 2022.02.18\n\n- **기획 의도**\n\n  코로나로 인해 비대면 수업이 증가하고 교육의 양상이 크게 변화하게 되었습니다.\n\n  이에,\n\n  1. 집에서 집중 환경을 만들기 어려운 학생들\n  2. 카페, 독서실로 나가서 공부하기엔 코로나가 걱정되는 학생들\n  3. 혼자 인강을 듣느라 소외감을 느끼는 학생들\n\n  을 타겟으로 <u>코호트 러닝 효과</u>를 통해 스스로 학습 의지를 다잡을 수 있는 서비스를 제공하고자 합니다.\n\n  > 코호트 러닝 효과?\n  >\n  > 공통적인 특성을 가진 사람들이 한데 모여 학습하는 것, 공부 효과와 정서적 안정이 극대화됨\n\n- **기대 효과**\n  1. 이동시간을 줄여 효율적인 공부!\n  2. 비대면 서비스로 코로나 확산 방지\n  3. 공부하는 시간에 따라 돈을 낼 필요가 없음\n  4. 언제 어디서나 시간과 장소에 구애받지 않고 독립적인 공부 습관 형성 가능\n\n<br>\n\n### 팀원 소개\n\n| 前 팀 장 | 팀 장 / BE | 팀 원 / FE | 팀 원 / FE | 팀 원 / BE |\n| :------: | :--------: | :--------: | :--------: | :--------: |\n|  김성현  |   김일환   |   심은조   |   정우철   |   하현서   |\n\n\n\n<details>\n  <summary> 팀규칙 </summary>\n  ?**카메라 항상 켜기**? <br>\n\n  ---\n\n  ?**휴식시간 철저히?** <br>\n  시간은 자유롭게!\n  갈 때, 올 때 채팅 남기기\n\n  ---\n\n  ?**코어 타임 집중하기?** <br>\n  10:00 - 12:00 오전 코어 타임 <br>\n  1:00 - 6:00 오후 코어 타임\n\n  개별 작업을 하게 되면 시간을 정해서 상시 대기해서 언제든지 소통을 할 수 있도록!\n\n  ---\n\n  ?**일일 회고 남기기?** <br>\n\n  5시 30분 회의실에 모여서 다같이 회고하기\n  하루의 소감, 힘들었던 부분, 기술적인 부분 중에서 아무거나!\n\n  ---\n\n  ⚽**트러블 슈팅 남기기**⚽ <br>\n\n  자세한 이슈 내용, 문제 원인, 시행착오 적어두기!\n\n  ---\n\n  ?**잠깨는 시간, 준비시간**? <br>\n\n  09:00- 09:05\n\n  ---\n\n  ?**잡담 시간**? <br>\n  09:05 - 09:30\n\n  - 한 주를 담당할 프로젝트 매니저(이하 PM)를 매주 선정\n  - PM의 역할\n      - PM은 팀원들이 그라운드 룰을 잘 지키는지 확인\n      - 평일 아침 스크럼 및 회의 진행\n\n  ---\n\n  ?**스크럼 시간**? <br>\n  09:30 - 10:00\n\n  ---\n\n  ?**점심 시간**? <br>\n\n  11:00 - 01:00\n\n  - 사이에 알아서 1시간 갖기\n  - 갈 때, 올 때 채팅 남기기\n\n  ---\n\n  ?**회고 시간**? <br>\n\n  05:30 - 6:00\n\n  - 금요일\n      - 한 주를 마무리하고 칭찬 / 아쉬운 점 공유 시간 갖기!\n</details>\n\n<details>\n  <summary> Git </summary>\n  \n  ### 규칙\n\n  - **기능 단위**로 Push → Merge Request 생성\n  - 팀원 모두 다른 사람이 작성한 코드 확인 후 Comment 작성 <br>\n  ‼본인 코드 뿐만 아니라 다른 사람 코드도 이해하기 ‼\n\n\n  ### Flow (Branch)\n\n  - **master** : 제품으로 출시될 수 있는 브랜치\n  - **dev** : 다음 출시 버전을 개발하는 브랜치\n  - **feature** : 기능을 개발하는 브랜치\n  - ex) 로그인 기능 위임 시\n\n       feature/login 브랜치 생성\n\n      ex) 같은 기능을 작업할 때 (로그인) → 이름의 이니셜 약어 이용하여 브랜치 생성\n\n       feature/login/sh\n\n       feature/login/hs\n\n\n  ### Commit Message Convention\n\n  - [https://overcome-the-limits.tistory.com/entry/협업-협업을-위한-기본적인-git-커밋컨벤션-설정하기](https://overcome-the-limits.tistory.com/entry/%ED%98%91%EC%97%85-%ED%98%91%EC%97%85%EC%9D%84-%EC%9C%84%ED%95%9C-%EA%B8%B0%EB%B3%B8%EC%A0%81%EC%9D%B8-git-%EC%BB%A4%EB%B0%8B%EC%BB%A8%EB%B2%A4%EC%85%98-%EC%84%A4%EC%A0%95%ED%95%98%EA%B8%B0)\n  - **태그: 제목** 형태 → ex) Feat: 로그인 기능\n\n  ### 자주 사용하는 명령어\n\n  - git push origin 브랜치명 → 원격 저장소로 해당 브랜치 push\n\n      ex) git push origin login\n\n  - git pull [원격저장소명] [원격저장소 브랜치명] → 원격 저장소에서 local로 pull\n\n      ex) git pull origin feature → 원격 저장소에 있는 feature 브랜치 pull\n\n  - git checkout -b 브랜치명 → 현재 있는 브랜치로부터 새로운 브랜치 생성(-b) 후 이동(checkout)\n\n      ex) git checkout -b login → login 브랜치 생성 후 이동\n</details>\n\n<br>\n\n### 프로젝트 명세\n\n- 기능 명세서\n\n  ![screenshot1](https://github.com//hyunse0/mogakgong/raw/master/README.assets/screenshot1.png)\n\n  개발을 시작하기 전, 개발 목표를 정확하게 팀원들과 공유하기 위해 기능 명세서를 작성하였습니다.\n\n  [기능 명세서 링크](https://docs.google.com/spreadsheets/d/18-CeEBBO8wSRqbJIzstc_J5Cyt1iNi4LRHm5akPiwvw/edit?usp=sharing)\n\n- 유즈케이스\n\n  ![screenshot2](https://github.com//hyunse0/mogakgong/raw/master/README.assets/screenshot2.png)\n\n  시스템이 어떻게 사용되어야 할지 다이어그램으로 가시화하여 이해를 돕도록 했습니다.\n\n  [유즈케이스 링크](https://app.diagrams.net/#G1sagDOmQBDiuSQeBHrKMscmzctqgiRLNo)\n\n- 와이어프레임\n\n  ![screenshot3](https://github.com//hyunse0/mogakgong/raw/master/README.assets/screenshot3.png)\n\n  우리 서비스의 특징과 기능 등을 시작적으로 정확하게 정의하기 위해 와이어프레임을 제작하였습니다.\n\n  [와이어프레임 링크](https://docs.google.com/presentation/d/1yVuQeDnOL--OQ7ABIADai3rTTZEwzWQRAwQoF91Pxrk/edit)\n\n- API 명세서\n\n  ![screenshot4](https://github.com//hyunse0/mogakgong/raw/master/README.assets/screenshot4.png)\n\n  Frontend와 Backend 개발자간 소통을 원활하게 하기 위해 작성했습니다. (swagger 이용)\n\n- 아키텍쳐\n\n  ![architecture.001](https://github.com//hyunse0/mogakgong/raw/master/README.assets/architecture.001.jpeg)\n\n<br>\n\n### 시연 영상\n\n- ##### 회원가입\n\n  이메일과 패스워드 입력 시 입력에 맞추어 즉시 피드백 가능\n\n![signup](https://github.com//hyunse0/mogakgong/raw/master/README.assets/signup.png)\n\n\n\n- ##### 로그인\n\n![login](https://github.com//hyunse0/mogakgong/raw/master/README.assets/login.gif)\n\n\n\n- ##### 로그인 전 메인 페이지\n\n  로그인하지 않아 \'내 스터디\'와 \'추천 스터디\'가 뜨지 않는 메인 페이지\n\n![main_before_login](https://github.com//hyunse0/mogakgong/raw/master/README.assets/main_before_login.gif)\n\n\n\n- ##### 로그인 후 메인 페이지\n\n![main](https://github.com//hyunse0/mogakgong/raw/master/README.assets/main.gif)\n\n\n\n- ##### 프로필 수정\n\n  닉네임과 생일, 목표 및 관심사 설정 가능\n\n![profile](https://github.com//hyunse0/mogakgong/raw/master/README.assets/profile.gif)\n\n\n\n- ##### 스터디룸 생성\n\n  카테고리와 해시태그를 추가할 수 있음\n\n  리뷰 페이지를 통해 입력을 잘못한 부분이 있는지 확인 가능\n\n![create_studyroom](https://github.com//hyunse0/mogakgong/raw/master/README.assets/create_studyroom.gif)\n\n\n\n- ##### 스터디룸 입장\n\n![studyroom](https://github.com//hyunse0/mogakgong/raw/master/README.assets/studyroom.gif)\n\n\n\n- ##### 채팅 기능\n\n![chatting](https://github.com//hyunse0/mogakgong/raw/master/README.assets/chatting.gif)\n','ㅁㅗㄱㅏㄱㄱㅗㅇ','http://k6c104.p.ssafy.io/images/projectImg/12939a30-8dff-4552-9252-92fcb5ffd363_KakaoTalk_20220519_103630081.png','모각공','2022-05-19 11:59:07.855183','W7KSeTIbp85TDdfSAWC93bjr+6oocLDaXSvf+6rAzbM='),(18,'관통','2022-05-19 11:53:45.702056','https://github.com/kimhyeongjun95/Navie','https://github.com/kimhyeongjun95/Navie',4,'당신의 인생영화를 찾아드리겠습니다. 우리는 \'Navie\' 입니다.','## ? 영화 커뮤니티 & 영화 추천 서비스 \'Navie\' ?\n\n>당신의 인생영화를 찾아드리겠습니다. 우리는 \'Navie\' 입니다.\n\n- 삼성청년SW아카데미 1학기 프로젝트 우수상 수상 프로젝트\n\n<br>\n\n##  ? 목차\n\n- [프로젝트 소개](#프로젝트-소개)\n  - [기획의도](#기획의도)\n  - [팀원](#팀원)\n  - [주요 역할](#주요-역할)\n  - [What is Navie?](#what-is-navie)\n  - [개발 규칙](#개발-규칙)\n\n- [프로젝트 디자인](#프로젝트-디자인)\n  - [Tech Stack](#tech-stack)\n  - [UI Design](#ui-design)\n  - [ERD Design](#erd-design)\n- [주요 기능](#주요-기능)\n  - [주요 기능 목록 및 설명](#주요-기능-목록-및-설명)\n\n<br>\n\n## 프로젝트 소개\n\n### 기획의도\n\n- **브레인 스토밍을 기반으로 한 기획 회의**를 통해 **\'사용자의 인생영화를 찾아주는 영화 커뮤니티를 만들어 보자!\'** 라는 기획의도를 도출하였습니다.\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처.PNG)\n\n<br>\n\n### 팀원\n\n<table>\n  <tr>\n    <td align=\"center\"><a href=\"https://github.com/hongjungkimm\"><img src=\"https://avatars.githubusercontent.com/u/87457152?v=4\" width=\"200px;\" alt=\"\"/><br /><sub><b>HONGJUNG</b></sub></a><br /></td>\n    <td align=\"center\"><a href=\"https://github.com/kimhyeongjun95\"><img src=\"https://avatars.githubusercontent.com/u/86656921?v=4\" width=\"200px;\" alt=\"\"/><br /><sub><b>HYEONGJUN</b></sub></a><br /></td>\n  </tr>\n</table>\n\n\n<br>\n\n### 주요 역할\n\n- **HONGJUNG**: ? **Back-End**\n- **HYEONGJUN**: ? **Front-End**\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처-1638673830734.PNG)\n\n<br>\n\n### What is Navie?\n\n- **\'Navie\'** 는 **\'Navigator**\' 와 **\'Movie\'** 를 합친 서비스명으로써 사용자의 인생영화를 찾아주겠다는 의미를 내포하고 있습니다.\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처-1638682938864.PNG)\n\n<br>\n\n### 개발 규칙\n\n- **협업**\n  - **개발 일지**를 꾸준하게 작성하여, 서로의 개발 현황을 공유합니다.\n  - 이슈가 발생하면, **즉시 공유하여 함께 해결**하기 위해 노력합니다.\n  - **Git Commit message 규칙**을 지킵니다. ex) <날짜> <변경유형> [<변경사항>]\n- **디자인**\n  - **Look & Feel**, 사용자가 보고 느끼는 것을 최우선으로 생각합니다.\n  - **일관된 디자인 컨셉**을 유지합니다.\n\n<br>\n\n## 프로젝트 디자인\n\n### Tech Stack\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처-1638684333815.PNG)\n\n<br>\n\n### Ui Design\n\n- **기존 영화 사이트들의 UI를 참고**하였습니다.\n- **Figma의 Community**에 있는 **여러 템플릿을 재가공하여 제작**하였습니다.\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처-1638684509593.PNG)\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처-1638684543760.PNG)\n\n<br>\n\n### ERD Design\n\n- **ERD cloud**를 사용하여 제작하였습니다.\n- **연계 테이블은 노란색으로 표시**하였습니다.\n- 기능 구현을 하는 중에 필요한 필드나 테이블을 추가하면서 **지속적으로 수정**하였습니다.\n\n![캡처](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/캡처-1638684705197.PNG)\n\n<br>\n\n## 주요 기능\n\n### 주요 기능 목록 및 설명\n\n? **회원가입 시연 영상** ?\n\n![signup](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/signup.gif)\n\n- **회원가입**\n  - 이름/아이디/비밀번호/비밀번호 확인/이메일을 입력하면 회원가입 되도록 구현하였습니다.\n  - **기존 아이디와 중복, 비밀번호 불일치시에는 다시 입력하도록 구현**하였습니다.\n  - **정보를 다 입력하지 않는다면 회원가입을 하지 못하도록 버튼을 비활성화**하였습니다.\n  - **CSS \'transition\' 을 적용하여 UI를 보강**하였습니다.\n\n<br>\n\n? **로그인 & 로그아웃 시연 영상** ?\n\n![login](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/login-1638789125263.gif)\n\n- **로그인 & 로그아웃**\n  - **아이디와 비밀번호를 입력하지 않으면 로그인하지 못하도록 로그인 버튼을 비활성화**하였습니다.\n  - 로그아웃은 버튼은 로그인한 회원만 보이도록 설정하였습니다.\n\n<br>\n\n? **아이디 찾기 & 로그아웃 시연 영상** ?\n\n![search](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/search.gif)\n\n- **아이디 찾기 & 비밀번호 찾기**\n  - **아이디 찾기**는 가입한 이름과 이메일 일치하면 아이디를 알려주도록 구현하였습니다.\n  - **비밀번호 찾기**는 **\'all auth\' 라이브러리를 이용**하여 사용자가 이메일 주소를 입력하면 그 이메일로 변경 url을 전송하도록 구현하였습니다.\n\n<br>\n\n? **C R U D 시연 영상** ?\n\n![crud](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/crud.gif)\n\n- **C R U D (영화 정보 조회, 영화 리뷰 작성/수정/삭제, 리뷰 댓글 작성/삭제)**\n  - **TMDB Movie Video API를 통해 가져온 유튜브 영상 Key를 활용하여 영화 예고편을 음소거 자동재생하도록 구현**하였습니다.\n  - **\'좋아요\' 기능을 구현**하였습니다.\n  - 로그인한 회원만 리뷰나 댓글을 작성할 수 있으며, 해당 리뷰 혹은 댓글을 작성자만 수정/삭제할 수 있도록 구현하였습니다.\n\n<br>\n\n? **회원정보 수정 시연 영상** ?\n\n![update](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/update.gif)\n\n- **회원정보 수정**\n  - 이름과 이메일만 변경 가능하도록 구현하였습니다.\n  - **프로필 이미지를 설정할 수 있도록 구현**하였습니다.\n  - 회원이 원하면 탈퇴를 할 수 있도록 구현하였습니다.\n\n<br>\n\n? **검색 & 프로필 시연 영상** ?\n\n![search_movie](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/search_movie.gif)\n\n- **검색 & 프로필**\n  - **검색**은 **영화, 리뷰, 장르, 배우, 키워드별 검색 결과를 조회 가능하도록 구현**하였습니다.\n  - **프로필에서는 페이지를 이동하지 않고 \'나의 관심 영화\', \'내가 쓴 리뷰\', 추천 인생영화\' 를 조회할 수 있도록 구현**하였습니다.\n\n<br>\n\n? **영화 월드컵을 통한 영화 추천 시연 영상** ?\n\n![worldcup](https://github.com//kimhyeongjun95/Navie/raw/master/README.assets/worldcup-1638789963409.gif)\n\n- **영화 월드컵을 통한 영화 추천**\n  - **TMDB에서 가져온 약 1000개의 영화 데이터를 통해 액션, 로맨스, 범죄, 공포, 코미디, SF, 가족, 음악 총 8개 장르의 대표 영화를 도출**하였습니다.\n  - **각 장르의 대표 영화**는 **장르 별로 TMDB 평점이 높은 순 그리고 최신 순으로 정렬한 후 랜덤으로 지정**하였습니다.\n  - 회원에게 각 장르의 대표 영화를 통한 **영화 월드컵을 진행하도로 구현**하였습니다.\n  - 최종 결승까지 올라간 2개의 영화는 공동 우승 처리되며, 그 **2개의 영화 장르를 기반으로 총 4개의 영화를 회원에게 추천하도록 구현**하였습니다.\n  - 회원이 인생영화 추천을 횟수 제한없이 받을 수 있도록 구현하였습니다.\n\n','Navie','http://k6c104.p.ssafy.io/images/projectImg/04ae9b00-af9e-403b-a0ee-fb4e86804f00_캡처.png','Navie','2022-05-19 11:59:02.067578','IzzmOoB/HjrBwcUoZh7QujzlwL599HKblA6CPvD+n68=');
